import { Route, Routes, Redirect } from 'react-router-dom';
import App from './App';
import Detail from './pages/Detail';

export const routes = () => {
  return (
    <div>
      {/* <NavBar /> */}
      <Routes>
        <Route exact path="/detail" element={<Detail/>} />
        <Route exact path="/" element={<App/>} />
      </Routes>
    </div>
  );
};
